import React, {Component} from "react"
import styled from 'styled-components' 
import Divvy from './Divvy.png';

class Projects extends Component {
  render(){
  return (
    <div>
      <h1>Projects/case study</h1>

      <br/>


        <div class="row justify-content-center">
        <div class="col-sm-10">
        <div class="card">
        <svg  width="100%" height="250" xmlns="http://www.w3.org/2000/svg" aria-label="Placeholder: Image cap" preserveAspectRatio="xMidYMid slice" role="img">
        </svg>

        <div class="card-body">
        <h5 class="card-title">Divvy Project</h5>
        <p class="card-text">It's a broader card with text below as a natural lead-in to extra content. This content is a little longer.</p>
        <p class="card-text"></p>
        <a href="#" class="btn btn-primary">View Case Study</a>
        </div>
        </div>
        </div>
        </div>








        <br/>







    </div>

    );

  }
}

export default Projects;
